import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Button, 
  Card, 
  CardContent, 
  Radio, 
  RadioGroup,
  FormControlLabel,
  FormControl, 
  CircularProgress, 
  Paper,
  Container
} from '@mui/material';

// Simple Questionnaire Component
const Questionnaire = ({ onComplete }) => {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Submit dummy data for testing
  const handleSubmit = () => {
    setLoading(true);

    // Simulate API call with dummy data
    setTimeout(() => {
      const dummyResult = {
        risk_assessment: {
          profile: "Moderate",
          risk_aversion: 3.5
        },
        portfolio: {
          weights: {
            "SPDR Straits Times Index ETF": 0.45,
            "Nikko AM Singapore STI ETF": 0.45,
            "Lion-OCBC Securities Hang Seng TECH ETF": 0.10
          },
          return: 0.12,
          volatility: 0.11,
          sharpe_ratio: 1.06
        },
        funds: {
          "SPDR Straits Times Index ETF": {
            metrics: {
              "Annualized Return": 0.117,
              "Annualized Volatility": 0.10
            },
            metadata: {
              fund_manager: "State Street Global Adv Singapore Ltd"
            }
          },
          "Nikko AM Singapore STI ETF": {
            metrics: {
              "Annualized Return": 0.121,
              "Annualized Volatility": 0.107
            },
            metadata: {
              fund_manager: "Nikko Asset Management Asia Limited"
            }
          },
          "Lion-OCBC Securities Hang Seng TECH ETF": {
            metrics: {
              "Annualized Return": 0.192,
              "Annualized Volatility": 0.372
            },
            metadata: {
              fund_manager: "Lion Global Investors Ltd"
            }
          }
        }
      };

      onComplete(dummyResult);
      setLoading(false);
    }, 1500);
  };

  // Loading state
  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '80vh' }}>
        <CircularProgress />
      </Box>
    );
  }

  // Error state
  if (error) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '80vh' }}>
        <Paper elevation={3} sx={{ p: 4, maxWidth: 500, textAlign: 'center' }}>
          <Typography variant="h5" color="error" gutterBottom>
            Error
          </Typography>
          <Typography>{error}</Typography>
          <Button 
            variant="contained" 
            color="primary" 
            sx={{ mt: 3 }}
            onClick={() => window.location.reload()}
          >
            Try Again
          </Button>
        </Paper>
      </Box>
    );
  }

  // Render simplified questionnaire for testing
  return (
    <Container maxWidth="md">
      <Box sx={{ width: '100%', my: 4 }}>
        <Typography variant="h4" align="center" gutterBottom>
          Investment Risk Assessment
        </Typography>

        <Typography variant="body1" align="center" color="textSecondary" paragraph>
          This questionnaire will help us understand your risk tolerance and investment goals.
        </Typography>

        <Card sx={{ my: 4 }}>
          <CardContent>
            <Typography variant="h6" gutterBottom>
              Sample Questionnaire
            </Typography>

            <Typography variant="body1" paragraph>
              For testing purposes, we've simplified the questionnaire. In a real implementation, 
              this would contain multiple questions about your investment goals, risk tolerance, etc.
            </Typography>

            <FormControl component="fieldset" fullWidth>
              <RadioGroup defaultValue="2">
                <FormControlLabel 
                  value="1" 
                  control={<Radio color="primary" />} 
                  label="Low risk tolerance" 
                />
                <FormControlLabel 
                  value="2" 
                  control={<Radio color="primary" />} 
                  label="Medium risk tolerance" 
                />
                <FormControlLabel 
                  value="3" 
                  control={<Radio color="primary" />} 
                  label="High risk tolerance" 
                />
              </RadioGroup>
            </FormControl>
          </CardContent>
        </Card>

        <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
          <Button
            variant="contained"
            color="primary"
            size="large"
            onClick={handleSubmit}
            disabled={loading}
          >
            Submit
            {loading && <CircularProgress size={24} sx={{ ml: 1 }} />}
          </Button>
        </Box>
      </Box>
    </Container>
  );
};

export default Questionnaire;
